// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

/*

1. :  Save the permission structure of the current address
    AdminSelf,  ProfessorSelf,  StudentSelf

2. : Save course details
    CourseInf,  CourseStudent

3. modifier function
    onlyAdmin,  onlyProfessor,  checkIsStudent


/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

4.1. setter function

    setcourseStudentCounts          // course id(,,)
                                    // Set the number of students with the course ID (called once when the student joins the course)


/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

4.2 getter function

    getMsgSender                    // msg.sender
    
    getMsgSenderAuthorization       // msg.sender

    ==> getIdByAddress()            // addressid , Find this person's id through address

    ==> getStuAddressByStuId()            // ID  ,  Find this person's address by ID

    getAuthorizationByAddress()     // addressauthorization , Find this person's authorization through address

/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

// getter about admin
    getAdminCounts()                // 
    getAdminIndexByAddress()        //  address adminindex , Find the index in admin by address

/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

// getter about professor
    getProfessorCounts()            // 
    getProfessorIndexByAddress()    //  address professorindex , Find the index in the professor by address
    getProfessorInfByProAddress()   // proAddresspro

/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

// getter about student
    getStudentCounts()              // 
    getStudentIndexByAddress()      //  address studentindex  ,Find the index in the student by address
    getStudentNameByAddress()
    getStudentNameById()
    getStudentInfByStuAddress()     // stuAddressstu

/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

// getter about course

    // about all course
    getIndexByCourseId              // course id    Get the index of this course by course ID
 
    getAllCourseId()                // course id

    getcourseStudentCounts          // course id  The number of students to get the course ID

    getCourseCounts()               // courseCounts  Return the current courseCounts value

    getCourseStudentsByCourseId()   // course id

    getCourseInfByCourseId()        // course id

    getTopStudentsByCourseId()      // course idn


    // pro
    getCourseCountsByProAddress()   //   Get a few courses taught by a certain teacher

    getCourseIdByProAddress()       // proAddressid   Get an array of all course IDs opened by a teacher through proAddress


    // stu
    getCourseCountsByStuAddress()   // 

    getCourseIdByStuAddress()       // stuAddressid   Get an array of all course IDs opened by a student through stuAddress



/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////

4.3. check function

    checkIdExisted()                // id         Verify that this ID has been used

    checkAddressExisted()           // address    Verify that this address has been used

    ////// check course

    checkCourseCanApply             // course id 
                                    // Check the course ID to see if you can apply for this course

    checkCourseExisted              // course id 
                                    // Check if this course exists by course ID

    checkCourseHeldByProBlockAddress        // courseId,proBlockAddress 
                                            // Check whether the professor owns the course through courseId,proId

    checkCourseHeldByStuBlockAddress        // courseId,stuBlockAddress 
                                            // Through courseId,stuId checks whether the student owns the course

    
*/



contract StructAndModifiers{

    address public modifiersOwner;   // 

    constructor() {
        modifiersOwner = msg.sender;
        adminSelfs[1] = AdminSelf(1,'Root',modifiersOwner,3);
        adminCounts++;
    }

//// Struct

    ////////////
    // admin //
    ///////////
    uint public adminCounts = 0; //
